import React, { useEffect, useRef } from 'react';
import { motion } from 'framer-motion';
import NextCourseSection from '../../components/CourseSections/NextCourseSection';
import { FaStethoscope, FaGraduationCap, FaClipboardCheck, FaBookMedical, FaUserMd, FaChalkboardTeacher } from 'react-icons/fa';
import './NExTPage.css';

const NExTPage = () => {
  const featuresRef = useRef(null);
  const curriculumRef = useRef(null);
  const testimonialsRef = useRef(null);

  useEffect(() => {
    const observerOptions = {
      threshold: 0.2,
      rootMargin: '0px'
    };

    const handleIntersection = (entries, observer) => {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          entry.target.classList.add('animate');
          observer.unobserve(entry.target);
        }
      });
    };

    const observer = new IntersectionObserver(handleIntersection, observerOptions);

    const featureElements = document.querySelectorAll('.next-feature');
    const curriculumElements = document.querySelectorAll('.curriculum-item');
    const testimonialElements = document.querySelectorAll('.testimonial');

    featureElements.forEach(el => observer.observe(el));
    curriculumElements.forEach(el => observer.observe(el));
    testimonialElements.forEach(el => observer.observe(el));

    return () => observer.disconnect();
  }, []);

  return (
    <div className="next-page">
      <div className="next-page-container">
        <motion.div 
          className="next-page-hero"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 1 }}
        >
          <div className="next-page-hero-content">
            <motion.h1
              initial={{ y: 30, opacity: 0 }}
              animate={{ y: 0, opacity: 1 }}
              transition={{ duration: 0.8, delay: 0.2 }}
            >
              Master the National Exit Test (NExT)
            </motion.h1>
            <motion.p
              initial={{ y: 30, opacity: 0 }}
              animate={{ y: 0, opacity: 1 }}
              transition={{ duration: 0.8, delay: 0.4 }}
            >
              Your Gateway to Medical Excellence - Comprehensive preparation for MBBS graduates
              with expert guidance, clinical skills training, and personalized learning paths.
            </motion.p>
            <motion.div
              initial={{ scale: 0 }}
              animate={{ scale: 1 }}
              transition={{ duration: 0.5, delay: 0.6 }}
              className="badge success lg"
            >
              NMC Approved Curriculum
            </motion.div>
          </div>
        </motion.div>
        
        <section className="next-page-about" ref={featuresRef}>
          <div className="container">
            <motion.h2
              initial={{ y: 30, opacity: 0 }}
              whileInView={{ y: 0, opacity: 1 }}
              viewport={{ once: true }}
              transition={{ duration: 0.8 }}
            >
              Why Choose Our NExT Program?
            </motion.h2>
            <motion.p
              initial={{ y: 20, opacity: 0 }}
              whileInView={{ y: 0, opacity: 1 }}
              viewport={{ once: true }}
              transition={{ duration: 0.8, delay: 0.2 }}
            >
              Experience a revolutionary approach to medical education with our comprehensive
              NExT preparation program, designed by leading medical experts and educators.
            </motion.p>
            <div className="next-features">
              <div className="next-feature">
                <div className="feature-icon">
                  <FaStethoscope />
                </div>
                <h3>Clinical Excellence</h3>
                <p>Master practical skills with hands-on training and real-world case studies</p>
              </div>
              <div className="next-feature">
                <div className="feature-icon">
                  <FaGraduationCap />
                </div>
                <h3>Expert Faculty</h3>
                <p>Learn from experienced medical professionals and renowned educators</p>
              </div>
              <div className="next-feature">
                <div className="feature-icon">
                  <FaClipboardCheck />
                </div>
                <h3>Comprehensive Assessment</h3>
                <p>Regular mock tests and performance analytics to track your progress</p>
              </div>
              <div className="next-feature">
                <div className="feature-icon">
                  <FaBookMedical />
                </div>
                <h3>Updated Content</h3>
                <p>Latest NMC guidelines and exam patterns incorporated into study material</p>
              </div>
              <div className="next-feature">
                <div className="feature-icon">
                  <FaUserMd />
                </div>
                <h3>Personalized Guidance</h3>
                <p>One-on-one mentoring and customized study plans for optimal results</p>
              </div>
              <div className="next-feature">
                <div className="feature-icon">
                  <FaChalkboardTeacher />
                </div>
                <h3>Interactive Learning</h3>
                <p>Engaging sessions with multimedia content and group discussions</p>
              </div>
            </div>
          </div>
        </section>
        
        <NextCourseSection />
        
        <section className="next-page-curriculum" ref={curriculumRef}>
          <div className="container">
            <motion.h2
              initial={{ y: 30, opacity: 0 }}
              whileInView={{ y: 0, opacity: 1 }}
              viewport={{ once: true }}
              transition={{ duration: 0.8 }}
            >
              Comprehensive NExT Curriculum
            </motion.h2>
            <motion.p
              initial={{ y: 20, opacity: 0 }}
              whileInView={{ y: 0, opacity: 1 }}
              viewport={{ once: true }}
              transition={{ duration: 0.8, delay: 0.2 }}
            >
              Our meticulously designed curriculum covers all aspects of the National Exit Test,
              ensuring thorough preparation for both theory and practical components.
            </motion.p>
            <div className="curriculum-grid">
              <div className="curriculum-item">
                <h3>Theory Excellence</h3>
                <ul>
                  <li>Comprehensive subject coverage</li>
                  <li>High-yield topic focus</li>
                  <li>Regular mock tests</li>
                  <li>Question bank access</li>
                  <li>Performance analytics</li>
                </ul>
              </div>
              <div className="curriculum-item">
                <h3>Clinical Mastery</h3>
                <ul>
                  <li>Hands-on clinical training</li>
                  <li>Case-based learning</li>
                  <li>Patient interaction skills</li>
                  <li>Diagnostic approach</li>
                  <li>Emergency management</li>
                </ul>
              </div>
              <div className="curriculum-item">
                <h3>Practical Skills</h3>
                <ul>
                  <li>Laboratory procedures</li>
                  <li>Medical equipment handling</li>
                  <li>Clinical examination techniques</li>
                  <li>Documentation practice</li>
                  <li>Communication skills</li>
                </ul>
              </div>
              <div className="curriculum-item">
                <h3>Exam Strategies</h3>
                <ul>
                  <li>Time management techniques</li>
                  <li>Answer writing skills</li>
                  <li>OSCE preparation</li>
                  <li>Viva preparation</li>
                  <li>Stress management</li>
                </ul>
              </div>
            </div>
          </div>
        </section>
        
        <section className="next-testimonials" ref={testimonialsRef}>
          <div className="container">
            <motion.h2
              initial={{ y: 30, opacity: 0 }}
              whileInView={{ y: 0, opacity: 1 }}
              viewport={{ once: true }}
              transition={{ duration: 0.8 }}
            >
              Success Stories
            </motion.h2>
            <div className="testimonials-slider">
              <div className="testimonial">
                <div className="testimonial-content">
                  <p>"The NExT preparation program exceeded my expectations. The comprehensive coverage and expert guidance helped me achieve excellent results. The clinical training was particularly beneficial."</p>
                </div>
                <div className="testimonial-author">
                  <img src="https://img.freepik.com/free-photo/woman-doctor-wearing-lab-coat-with-stethoscope-isolated_1303-29791.jpg" alt="Dr. Priya Sharma" />
                  <div>
                    <h4>Dr. Priya Sharma</h4>
                    <p>MBBS Graduate, 2023</p>
                  </div>
                </div>
              </div>
              
              <div className="testimonial">
                <div className="testimonial-content">
                  <p>"The structured approach to preparation and regular assessments helped me stay on track. The faculty's support and guidance were invaluable throughout my journey."</p>
                </div>
                <div className="testimonial-author">
                  <img src="https://img.freepik.com/free-photo/portrait-smiling-male-doctor_171337-1532.jpg" alt="Dr. Rahul Patel" />
                  <div>
                    <h4>Dr. Rahul Patel</h4>
                    <p>MBBS Graduate, 2023</p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>
        
        <motion.section 
          className="next-cta"
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          viewport={{ once: true }}
          transition={{ duration: 1 }}
        >
          <div className="container">
            <div className="cta-content">
              <motion.h2
                initial={{ y: 30, opacity: 0 }}
                whileInView={{ y: 0, opacity: 1 }}
                viewport={{ once: true }}
                transition={{ duration: 0.8 }}
              >
                Begin Your Journey to Success
              </motion.h2>
              <motion.p
                initial={{ y: 20, opacity: 0 }}
                whileInView={{ y: 0, opacity: 1 }}
                viewport={{ once: true }}
                transition={{ duration: 0.8, delay: 0.2 }}
              >
                Join our comprehensive NExT preparation program and take the first step
                towards your successful medical career. Limited seats available!
              </motion.p>
              <motion.button 
                className="btn-primary"
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
              >
                Enroll Now
              </motion.button>
            </div>
          </div>
        </motion.section>
      </div>
    </div>
  );
};

export default NExTPage;
